import React from 'react';

function About() {
  return (
    <div className="black">
        <h1>About</h1>
        <p>This website is just a side project that I am working on whenever I find the time to.
        This website is written with React Hooks
        </p>
        <h2>Me:</h2>
        <p>Niklas Becker <br /><br />
        niklasbeckerr@gmail.com <br /><br />
        Github: niklasbec <br /><br />
        If you would like to contact me please write me an email and I will get back to you as soon as I can! <br /><br />

        </p>
        <p></p>
    </div>
  );
}

export default About;
